description:
Viata cu Louie (Romana) [Toate 3 sezoanele]

Aceste materiale video pot spune ca sunt cele mai clare pe care le-am putut gasii, initiat au fost in limba engleza dar le-am dublat personal in romana folosindu-ma de sunetele altor inregistrari de pe net. 

Problema sincronizarii proaste a sunetelor peste imagine este de domeniul trecutului acum.

Si desigur, multumiri speciale lui s-mouche pentru inregistrarea acestor materiale.


