Life with Louie is an American animated series. Debuting on December 18, 1994 as a Fox Kids Christmas special, it began its first season in fall of 1995 and lasted until March 1998. Life with Louie is based on the childhood of stand-up comedian Louie Anderson, growing up with his family in Wisconsin.


